export class InfectionPulmonaire {
    IdInfectionPulmonaire: number;
    PatientId: number;
    Pulmonaire: boolean;
    Nombre: number;
    Date: string;
    LieuHospitalisation: string;
    Dyspnee?: boolean;
    DouleurThoraciques?: boolean;
    Fievre?: boolean;
    FoyerRadiologique?: boolean;
    Desaturation?: boolean;
    Autre?: boolean;
    PreciserAutre?: string;
    SaO2: number;
    GermeIsole: boolean;
    TypeGermeIsole?: string;
    Siege?: string;
    HyperhydratationPerso?: boolean;
    HyperhydratationIv?: boolean;
    AntalgiquesPalliesI?: boolean;
    AntalgiquePallierIi?: boolean;
    AntalgiquePallierIii?: boolean;
    TransfusionSimple?: boolean;
    EchangeTransfusionnel?: boolean;
    TypeAntibiotherapie: string;
    Duree: number;

    constructor() {
        this.IdInfectionPulmonaire = 0;
        this.PatientId = 0;
        this.Pulmonaire = false;
        this.Nombre = 0;
        this.Date = '';
        this.LieuHospitalisation = '';
        this.Dyspnee = false;
        this.DouleurThoraciques = false;
        this.Fievre = false;
        this.FoyerRadiologique = false;
        this.Desaturation = false;
        this.Autre = false;
        this.PreciserAutre = '';
        this.SaO2 = 0;
        this.GermeIsole = false;
        this.TypeGermeIsole = '';
        this.Siege = '';
        this.HyperhydratationPerso = false;
        this.HyperhydratationIv = false;
        this.AntalgiquesPalliesI = false;
        this.AntalgiquePallierIi = false;
        this.AntalgiquePallierIii = false;
        this.TransfusionSimple = false;
        this.EchangeTransfusionnel = false;
        this.TypeAntibiotherapie = '';
        this.Duree = 0;
    }
}
